import React, { FC } from 'react';
import Layout from '../components/Layout';
import IntroCard from '../components/IntroCard';

const Home: FC = () => {
  return (
    <>
      <Layout>
        <IntroCard
          name="Ricardo Rodrigues"
          description="Front End Developer"
        />
      </Layout>
    </>
  );
};

export default Home;
